import React, { useEffect, useState, useMemo } from "react";
import { useTheme, makeStyles, Stack, Text, Image } from "@fluentui/react";
import { useFloating, offset } from "@floating-ui/react";
import { withMap } from "react-tomtom-maps";
import MapControl from "./MapControl";
import LayersIcon from "../../../icons/LayersIcon";
import Fade from "../../../components/Fade";
import { useAppContext } from "../../../app/AppContext";
import useButtonStyles from "../../../hooks/useButtonStyles";

const useStyles = (props) =>
  makeStyles((theme) => ({
    popup: {
      backgroundColor: theme.palette.white,
      borderRadius: theme.spacing.m,
      padding: theme.spacing.m,
      boxShadow: theme.floatingElementShadow
    },
    item: {
      display: "flex",
      flexDirection: "column"
    },
    itemMap: {
      width: 120,
      height: 100,
      borderStyle: "solid",
      borderRadius: 8,
      borderWidth: 2.5,
      borderColor: props?.selected ? theme.palette.themePrimary : "#727c85",
      cursor: "pointer",
      transition: "border 0.3s"
    },
    itemLabel: {
      fontFamily: "Noto Sans",
      textAlign: "center",
      marginTop: theme.spacing.s1
    }
  }));

const imageSources = {
  street:
    "data:image/png;base64,",
  satellite:
    "data:image/png;base64,"
};

const MapItem = ({ mapStyle, selected, onSelected }) => {
  const classes = useStyles({ selected })();
  const { name, label } = mapStyle;

  const handleClick = () => {
    onSelected(name);
  };

  return (
    <Stack.Item className={classes.item} onClick={handleClick}>
      <Image className={classes.itemMap} src={imageSources[name]} />
      <Text className={classes.itemLabel} variant="medium">
        {label}
      </Text>
    </Stack.Item>
  );
};

const MapStylesPopup = React.forwardRef(
  ({ isOpen, selected, onSelected, onDismiss, ...otherProps }, ref) => {
    const theme = useTheme();
    const classes = useStyles()();
    const { mapStyles } = useAppContext();

    const items = useMemo(
      () =>
        Object.keys(mapStyles).map((name) => {
          const mapStyle = mapStyles[name];
          return (
            <MapItem
              key={name}
              mapStyle={mapStyle}
              selected={name === selected}
              onSelected={onSelected}
            />
          );
        }),
      [mapStyles, selected]
    );

    return isOpen ? (
      <div ref={ref} className={classes.popup} {...otherProps}>
        <Stack tokens={{ childrenGap: theme.spacing.s1 }}>{items}</Stack>
      </div>
    ) : null;
  }
);

const MapSwitcher = ({
  map,
  selected = "street",
  onSelected = () => {},
  visible = true
}) => {
  const theme = useTheme();
  const buttonClasses = useButtonStyles();
  const { refs, floatingStyles } = useFloating({
    placement: "left-start",
    middleware: [offset({ mainAxis: 12 })]
  });
  const [popupIsOpen, setPopupIsOpen] = useState(false);

  useEffect(() => {
    map.on("click", hidePopup);
    return () => map.off("click", hidePopup);
  }, []);

  useEffect(() => {
    if (!visible) {
      setPopupIsOpen(false);
    }
  }, [visible]);

  const showPopup = () => setPopupIsOpen(true);

  const hidePopup = () => setPopupIsOpen(false);

  return (
    <>
      <Fade show={visible} duration="0.15s">
        <div
          className={buttonClasses.mapControlButton}
          ref={refs.setReference}
          onClick={showPopup}
        >
          <LayersIcon color={theme.palette.black} />
        </div>
      </Fade>
      <MapStylesPopup
        ref={refs.setFloating}
        style={floatingStyles}
        selected={selected}
        onSelected={onSelected}
        isOpen={popupIsOpen}
      />
    </>
  );
};

const MapSwitcherControl = ({ position = "top-right", ...otherProps }) => (
  <MapControl position={position}>
    <MapSwitcher {...otherProps} />
  </MapControl>
);

export default withMap(MapSwitcherControl);
